import TodoList from './TodoList'

function App() {
  const [todos, setTodos]=useState([{id: 1, name: 'Todo 1', completed: false}])
  return (
    <>
      <TodoList todoList={todos}/>
      <input type="text"></input>
      <button>Add to do</button>
      <button>Clear completed</button>
    </>
  )
}

export default App;
